(2758, 'ofe2758', '81209-lubricante-imola_105046.jpg', 'UN LUBRICANTE IDEAL PARA EL BOLSILLO!!!', 'TRATANDO SIEMPRE DE OFRECERTE BUENOS PRECIOS TE TRAEMOS UN PRODUCTO \"BUENO Y BARATO\", LUBRICANTE MULTIUSO IMOLA aw99 DE 237ml a solo $69,80 MENOS TUS DESCUENTOS + IVA (81209)\r\nUN PRECIO INSUPERABLE!! NO DEJES DE PEDIRLO! ', '0.00', 6, 24, '2019-02-10', 120, 0, ''),
