(2791, 'ofe2791', '', 'Mas perlitas para el collar ...', 'Hoy te enviamos una nueva perlita para el collar que venis armando hace un tiempo y siempre le falta algo. Mira que te trajimos, el resorte original del eje selector de cambio para Rouser NS 200 y con un descuentito adicional para endulsarte un poco y asi te resulte mas facil hacer click en comprar.\r\nNo olvides que al precio publicado ademas debes agregarle tus descuentos habituales.\r\n', '0.00', 5, 45, '2019-02-24', 100, 0, ''),
