(2852, 'ofe2852', '', 'Oferton de semana corta !!!', 'Ya que tenemos pocos dias, tendremos que esmerarnos con las ofertas para lograr tentarlos.\r\nPor ese motivo para hoy proponemos un 30% de descuento en la canilla de combustible para Yamaha YBR (modelo de canilla sin filtro de combustible)\r\nAprovechar la promo es tan facil como hacer click en el boton comprar y no te olvides que ademas tenes que adicionar tus descuentos habituales al precio publicado !!!!', '0.00', 30, 26, '2019-03-31', 200, 0, ''),
(2853, 'ofe2853', '', 'Mas articulos para Rouser', 'Aprovecha el cupulino para los modelos de Rouser mas viejos (180-220) con un descuento adicional para hacer mas facil la decision de hacer click en comprar y no olvides de adicionar tus descuentos habituales al precio publicado.\r\n\r\n', '0.00', 15, 1, '2019-03-31', 3, 0, ''),
