(2860, 'ofe2860', '', 'Herramientas practicas', 'Infaltable en la mochila o caja de herramientas del que sale a rutear o trabaja con la moto.\r\nTe ofrecemos unas practicas palancas saca cubiertas con un Super descuento que las hace mas atractivas aun. \r\nNo dejes de tenerlas para ofrecerlas en tu comercio, solo debes hacer click en el boton comprar y listo !!! \r\nY no olvides que al precio publicado debes agregar tus descuentos habituales.\r\n', '0.00', 50, 46, '2019-03-31', 250, 0, ''),
(2861, 'ofe2861', '', 'Esas pequeñas piezas del carburador . . ', 'Seguimos ofreciendote mas de esas pequeñas cosas que hacen al dia a dia, a veces lo complican y no mueven la caja, pero hay que tenerlos para salvar al cliente y algunas veces tambien a nosotros mismos!!\r\nHoy te ofrecemos el resorte universal para el regitro de cortina y como si tuviera un precio excesivo ademas le aplicamos un descuento para que casi no te cueste nada !!!\r\nNo dejes de aprovecharlos, solo tenes que hacer click en el boton comprar y listo !!!', '0.00', 30, 130, '2019-04-14', 600, 0, ''),
