(2906, 'ofe2906', '', 'DEL PEDAL A LA BOMBA...', 'BOMBA DE FRENO TRASERA UNIVERSAL,ENDUROS Y CUATRIS,TOTALMENTE ADAPTABLES...$615,12 MENOS DESCUENTOS HABITUALES + IVA...(CODIGO M.L. 37047)', '0.00', 0, 8, '2019-05-03', 50, 0, ''),
(2907, 'ofe2907', 'cable-embrague-tnt-300_174432.jpg', 'BUENAS NOTICIAS....', 'PRIMICIA,CABLE DE EMBRAGUE PARA BENELLI TNT 300 CHINO,PERO ESA NO ES TODA LA PRIMICIA,TE DIGO EL PRECIO,QUE ES LO MEJOR...$150,04 + IVA (CODIGO NUEVO M.L. 89367)', '0.00', 0, 5, '2019-05-01', 20, 0, ''),
(2908, 'ofe2908', '', 'Plasticos FZ 16', 'Por que no ofrecerte un buen descuento en plasticos para carroceria de calidad y pintados en color negro para Yamaha FZ 16\r\nHoy le toca al plastico cubre tanque superior con un descuento  que lo hace irresistible !!!!\r\nQueres ganar mas $$$ ?? Entonces estas solo a un click de lograrlo y ademas no olvides que al precio publicado debes aplicarle tus descuentos habituales, te sugerimos revises en nuestra pagina web las otras ofertas que recibiste y te interesaron pero las dejaste para despues, ya que se van venciendo y tambien muchas se agotan !!!', '0.00', 30, 7, '2019-04-28', 30, 0, ''),
(2909, 'ofe2909', '', 'Mas plasticos de FZ 16', 'Aca va otro ofertazo con un descuento increible del 50% \r\nTe ofrecemos el lateral de tanque lado derecho original color negro pintado por casi nada !!!!!\r\nNo lo dejes pasar, hace click en el boton comprar y segui ganado mas $$$ comprando en ML Repuestos !!!', '0.00', 50, 4, '2019-04-28', 16, 0, ''),
(2910, 'ofe2910', 'pastilla-new-crypton_134714.jpg', 'BUSCAS UN BUEN PRECIO??', 'PRECIO DE REMATE,UN BLACK FRIDAY EN PASTILLAS DE FRENO NEW CRYPTON / NEW YBR 2012....$101,64 + IVA,COMO PARA ROMPER EL HIELO !!!(CODIGO NUEVO M.L.37486),VAS A SEGUIR ESPERANDO?', '1.00', 0, 6, '2019-05-02', 30, 0, ''),
(2911, 'ofe2911', '', 'Ofertazo !!!', 'Solo por hoy !!!! Ruleman 6301 2RS con un 49% de descuento !!! Al precio publicado aplica tus descuentos habituales !!!!\r\nNo dejes de aprovecharlo y tampoco el listado de aplicaciones que te enviamos en la semana, es momento de hacer una revisada de como andas de rulemanes ahora que ya sabes sus aplicaciones en los diferentes modelos y marcas que te hicimos llegar !!!!\r\n', '0.00', 49, 650, '2019-04-28', 5000, 0, ''),
(2912, 'ofe2912', '', 'MAS POWER..', 'BUSCABAS UN CHANCHITO CON MAS FUERZA,ESTE TIENE DOBLE FUSIBLE,Y MAS REFORZADO QUE OTROS,TIPO XTZ250 / YBR 250,FUERA DE TODO LO QUE TE PUEDAN OFRECER POR AHI...(CODIGO M.L. 66831)...$377,96 MENOS DESCUENTOS HABITUALES + IVA', '0.00', 0, 3, '2019-05-04', 15, 0, ''),
(2913, 'ofe2913', '', 'TODAVIA ESTAS A TIEMPO !!!', 'PREPARATE PARA ESTE INVIERNO,TAL ES ASI,QUE ES LA TEMPORADA DE BATERIAS,NUEVAS O RECARGAS,PERO PARA OLVIDARTE Y PASAR EL FRIO,HOY TENES POR EJEMPLO LA BATERIA YTX7-ABS DE GEL A $1239,92 MENOS DESCUENTOS HABITUALES + IVA (CODIGO M.L.68129)...CONSULTA POR OTRAS MEDIDAS  DISPONIBLES,..ESO SI,APAURATE !!!', '0.00', 0, 13, '2019-05-07', 30, 0, ''),
(2914, 'ofe2914', '', 'Oferton en baterias !!!!', 'Te acercamos un super descuento de 45% en la bateria YB12A-B para que llegues con energias renovadas al feriado largo de Pascua.\r\nSolo tenes que hacer click en el boton comprar y estas aprovechando esta oportunidad, ademas no olvides que al precio publicado debes aplicarle tus descuentos habituales !!!', '0.00', 45, 6, '2019-06-26', 20, 0, ''),
(2915, 'ofe2915', '', 'TAMBIEN LLEGO !!!', 'LAMPARA TIPO FUTURA ,OPTICA DOBLE LAMPARA 12/18/18 CULOTE SMASH....(CODIGO M.L. 62814)...$34,76 + IVA...APURATE,QUEDAN POCAS!!!', '0.00', 12, 30, '2019-06-26', 100, 0, ''),
(2916, 'ofe2916', '', 'APOSTA A LO NACIONAL...', 'HOY DIA NACIONAL Y POR ENDE, DE DESCUENTOS A TODOS ESTOS PRODUCTOS,MIERCOLES DE OFERTA,TRAPP JETSON PARA SKUA 150 O EL QUE NECESITES,EL PUBLICADO HOY...$1467,88 + IVA ', '0.00', 15, 2, '2019-06-30', 8, 0, ''),
